const apiKey = 'b69ce63df91b692b402e8436d1099819';
const TMDBURL = 'https://api.themoviedb.org/3/movie';

export async function otts() {
  return await fetch(
    `https://api.themoviedb.org/3/watch/providers/tv?api_key=b69ce63df91b692b402e8436d1099819&language=ko&watch_region=KR`,
  ).then((res) => res.json());
}
